import React from 'react';
import { useHistory } from 'react-router-dom';

const Home = () => {
    const history = useHistory();
    const handleClick = () => history.push('/about');

    return (
        <>
            <h2>Home Page</h2>
            <button type="button" onClick={handleClick}>
                Add User
    </button>
    <h3>Count : 0</h3>
        </>
    );
};

export default Home;
